import React, { useEffect } from "react";
import "./Portfolio.css";
import { Card, CardDeck, Button, Row, Col } from "react-bootstrap";
import Container from "@material-ui/core/Container";
import Covid from "../files/covidTracker.png";
import { Github, BoxArrowUpRight } from "react-bootstrap-icons";
import WOW from "wowjs";

export default function Portfolio() {
  useEffect(() => {
    new WOW.WOW({}).init();
  });

  return (
    <div className="portfolioComponent">
      <Container className="portfolioContainer">
        <Row>
          <h3>Recent projects</h3>
          <Col>
            <CardDeck>
              <Card
                className="cardPortfolioCovid text-white text-center wow fadeInDown"
                xs={12}
                sm={12}
                md={3}
                lg={3}
              >
                <Card.Img className="portfolioImg img-fluid" src={Covid} />
                <Card.ImgOverlay className="cardImgOverelay">
                  <Card.Title className="cardTitle">
                    COVID-19 Tracker
                  </Card.Title>
                  <Button
                    className="cardButton"
                    href={"https://covid19-healthdata.herokuapp.com/"}
                    target="_blank"
                  >
                    <BoxArrowUpRight className="mr-2" />
                    View project
                  </Button>
                  <Button
                    className="cardButton"
                    href={
                      "https://github.com/ErlensGadzans/Covid-19-tracker-FE"
                    }
                    target="_blank"
                  >
                    <Github className="mr-2" />
                    See the code
                  </Button>
                </Card.ImgOverlay>
              </Card>
              <Card
                className="cardPortfolioWeatherApp text-white text-center wow fadeInDown "
                xs={12}
                sm={12}
                md={3}
                lg={3}
              >
                <Card.Img className="portfolioImg" src={Covid} />
                <Card.ImgOverlay className="cardImgOverelay">
                  <Card.Title className="cardTitle">
                    COVID-19 Tracker
                  </Card.Title>
                  <Button
                    className="cardButton"
                    href={"https://covid19-healthdata.herokuapp.com/"}
                    target="_blank"
                  >
                    <BoxArrowUpRight className="mr-2" />
                    View project
                  </Button>
                  <Button
                    className="cardButton"
                    href={
                      "https://github.com/ErlensGadzans/Covid-19-tracker-FE"
                    }
                    target="_blank"
                  >
                    <Github className="mr-2" />
                    See the code
                  </Button>
                </Card.ImgOverlay>
              </Card>
              <Card
                className="cardPortfolioSocialMedia text-white text-center wow fadeInDown"
                xs={12}
                sm={12}
                md={3}
                lg={3}
              >
                <Card.Img className="portfolioImg" src={Covid} />
                <Card.ImgOverlay className="cardImgOverelay">
                  <Card.Title className="cardTitle">
                    COVID-19 Tracker
                  </Card.Title>
                  <Button
                    className="cardButton"
                    href={"https://covid19-healthdata.herokuapp.com/"}
                    target="_blank"
                  >
                    <BoxArrowUpRight className="mr-2" />
                    View project
                  </Button>
                  <Button
                    className="cardButton"
                    href={
                      "https://github.com/ErlensGadzans/Covid-19-tracker-FE"
                    }
                    target="_blank"
                  >
                    <Github className="mr-2" />
                    See the code
                  </Button>
                </Card.ImgOverlay>
              </Card>
            </CardDeck>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
